import { useSpring, animated } from "react-spring";
import styled from "styled-components";
import { Button } from "../components";

const Nav_Button = (props) => Button({ type: "Nav", ...props });

const Container = animated(styled.div`
  position: fixed;
  transition: 0.2s cubic-bezier(0.075, 0.82, 0.165, 1);
  width: 100%;
  z-index: 99;
`);

function Nav({ show }) {
  const { y } = useSpring({
    translate: show ? "translateY(0%)" : "translateY(-100%)",
  });
  return (
    <Container style={{ y }}>
      <Nav_Button>Sports</Nav_Button>
      <Nav_Button>Roster</Nav_Button>
      <Nav_Button>Contact</Nav_Button>
    </Container>
  );
}

export default Nav;
